import React from 'react'
import styled from 'styled-components';

const CardActivities = ({key, id, name, season, duration, dificult, created}) => {
  return (
    <ActivityContainer key={key}>
      <span>{id}</span>
      <div>
        <h1>Actividad:</h1>
        <h1>{name}</h1>
      </div>
      <h2>Temporada: {season}</h2>
      <p>Duraci√≥n: {duration} hrs</p>
      <p>Dificultad: {dificult}</p>
      <p>Creada el: {created}</p>

    </ActivityContainer>
  )
}

export default CardActivities;


const ActivityContainer = styled.section`
  display: flex;
  border: 1px solid black;
  flex-direction: column;
  text-align: center;
  padding: .5rem;
  &:nth-child(5){
    grid-column: 2/4;
  }
  &:nth-child(7),
  :nth-child(1) {
    grid-column: 1/3;
  }
  &:nth-child(1){
    grid-column: 1/3;
  }
`
